import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar'
import ListWorkers from './components/ListWorkers'


function App() {



  return (
    <Routes>
      <div className="container">
        <div className="app">
          <Navbar />
          <Route path='/' exact component={ListWorkers} />
        </div>
      </div>
    </Routes>
  );
}

export default App;
